CREATE TABLE `as_zona`  (
  `zonaID` int(11) NOT NULL AUTO_INCREMENT,
  `zonaName` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `zonaStatus` char(1) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `createdDate` datetime(0) NOT NULL,
  `createdUserID` int(11) NOT NULL,
  `modifiedDate` datetime(0) NOT NULL,
  `modifiedUserID` int(11) NOT NULL,
  PRIMARY KEY (`zonaID`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 10 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Compact;

