-- ----------------------------
-- Table structure for bahan_stok
-- ----------------------------
DROP TABLE IF EXISTS `bahan_stok`;
CREATE TABLE `bahan_stok`  (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `bahanBarcode` varchar(30) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `jumlah` int(11) NOT NULL DEFAULT 0,
  `min_stok` int(11) NULL DEFAULT NULL,
  `max_stok` int(11) NULL DEFAULT NULL,
  `LastUpdate` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0),
  `Blokir` int(11) NOT NULL DEFAULT 0,
  `Bebas` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`Id`) USING BTREE,
  INDEX `Kode`(`bahanBarcode`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for bahan_stok_detail
-- ----------------------------
DROP TABLE IF EXISTS `bahan_stok_detail`;
CREATE TABLE `bahan_stok_detail`  (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `IdStok` int(11) NOT NULL DEFAULT 0,
  `jumlah_detail` int(11) NOT NULL DEFAULT 0,
  `IdGd` int(11) NOT NULL DEFAULT 0,
  `LastUpdate` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0),
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for ci_sessions
-- ----------------------------
DROP TABLE IF EXISTS `ci_sessions`;
CREATE TABLE `ci_sessions`  (
  `id` varchar(128) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `ip_address` varchar(45) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `timestamp` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `data` blob NOT NULL,
  INDEX `ci_sessions_timestamp`(`timestamp`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Compact;

