-- ----------------------------
-- Table structure for products_stok
-- ----------------------------
DROP TABLE IF EXISTS `products_stok`;
CREATE TABLE `products_stok`  (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `productBarcode` varchar(30) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `jumlah` int(11) NOT NULL DEFAULT 0,
  `min_stok` int(11) NULL DEFAULT NULL,
  `max_stok` int(11) NULL DEFAULT NULL,
  `LastUpdate` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0),
  `Blokir` int(11) NOT NULL DEFAULT 0,
  `Bebas` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`Id`) USING BTREE,
  INDEX `Kode`(`productBarcode`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for products_stok_detail
-- ----------------------------
DROP TABLE IF EXISTS `products_stok_detail`;
CREATE TABLE `products_stok_detail`  (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `IdStok` int(11) NOT NULL DEFAULT 0,
  `jumlah_detail` int(11) NOT NULL DEFAULT 0,
  `IdGd` int(11) NOT NULL DEFAULT 0,
  `LastUpdate` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0),
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for produk_stok_addjust
-- ----------------------------
DROP TABLE IF EXISTS `produk_stok_addjust`;
CREATE TABLE `produk_stok_addjust`  (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `IdStok` int(11) NOT NULL DEFAULT 0,
  `jumlah_prev` float NOT NULL DEFAULT 0,
  `jumlah_new` float NULL DEFAULT NULL,
  `IdGd` int(11) NOT NULL DEFAULT 0,
  `user` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `updatedate` date NOT NULL,
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for proyek
-- ----------------------------
DROP TABLE IF EXISTS `proyek`;
CREATE TABLE `proyek`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `nama` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `klien_id` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `spk_no` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `spk_tgl` date NULL DEFAULT NULL,
  `biaya` bigint(20) UNSIGNED NULL DEFAULT NULL,
  `tgl_mulai` date NULL DEFAULT NULL,
  `tgl_selesai` date NULL DEFAULT NULL,
  `status` enum('Start','Pending','Cancel','Close') CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL DEFAULT 'Start',
  `keterangan` text CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `klien_id`(`klien_id`) USING BTREE,
  CONSTRAINT `proyek_ibfk_1` FOREIGN KEY (`klien_id`) REFERENCES `klien` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for rl_report
-- ----------------------------
DROP TABLE IF EXISTS `rl_report`;
CREATE TABLE `rl_report`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `kode_rl` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `posisi` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `keaadaan_l` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `keaadaan_p` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `kebutuhan_l` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `kebutuhan_p` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 188 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Compact;

